const {ROSHAMBO_MOVES} = require('../common');
const {Game, Roshambo, Attempt} = require('../api/models');

function marshallAttempts(gameId, skater1, skater2, tricks) {
  const attempts = [];
  tricks.forEach(trick => {
    const roundAttempts = [];
    trick.attempts.forEach((attempt, index) => {
      if (attempt.result !== -1) {
        const offense = trick.setter === index;
        roundAttempts[offense ? 0 : 1] = {
          successful: Boolean(attempt.result),
          offense,
          redos: attempt.redos,
          game_id: gameId,
          trick_id: trick.id,
          skater_id: index ? skater2 : skater1
        };
      }
    });

    attempts.push(...roundAttempts);
  });

  return attempts;
}

function marshallRoshambos(gameId, skater1, skater2, roshambos) {
  const marshalled = [];
  roshambos.forEach((moves, round) =>
    moves.forEach((move, index) => {
      marshalled.push({
        round: round + 1,
        move: ROSHAMBO_MOVES[move],
        game_id: gameId,
        skater_id: index ? skater2 : skater1
      });
    })
  );
  return marshalled;
}

